import React from 'react';

function Login() {
    return (
        <>
            <p>Login</p>
            <label title="Username" for="username">Username</label>
            <input id="username" type="text" />
            <label title="Password" for="password">Password</label>
            <input id="password" type="password" />
        </>
    );
}

export default Login;
